The solution was to create a separate interface for each relationship, which is a pain, but worked:
lookUp(name: string): Promise<Person | Spouse> {
    return this.peopleService.getPerson(name)
      .then(person => {
        if (person.marriage) {
          return this.peopleService.getSpouse(person.marriage.person_id);
        }
      })
      .then(spouse => {
        return spouse;
      });
  }

I wish the API had accounted for this scenario from the start.
